import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(
  name: string,
  calories: number,
  fat: number,
) {
  return { name, calories, fat};
}
const rows = [
  createData('00:00', 159, 6.0),
  createData('01:00', 237, 9.0),
  createData('02:00', 262, 16.0),
  createData('03:00', 305, 3.7),
  createData('04:00', 356, 16.0),
  createData('05:00', 356, 16.0),
  createData('06:00', 356, 16.0),
  createData('07:00', 356, 16.0),
  createData('08:00', 356, 16.0),
  createData('09:00', 356, 16.0),
  createData('10:00', 356, 16.0),
  createData('11:00', 356, 16.0),
  createData('12:00', 356, 16.0),
  createData('13:00', 356, 16.0),
  createData('14:00', 356, 16.0),
  createData('15:00', 356, 16.0),
  createData('16:00', 356, 16.0),
  createData('17:00', 356, 16.0),
  createData('18:00', 356, 16.0),
  createData('19:00', 356, 16.0),
  createData('20:00', 356, 16.0),
  createData('21:00', 356, 16.0),
  createData('22:00', 356, 16.0),
  createData('23:00', 356, 16.0),
];

export default function DenseTable() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ maxWidth: 150 }} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Hora</TableCell>
            <TableCell align="right">Autos</TableCell>
            <TableCell align="right">Camiones/Ã“mnibus</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
